import About from "../Pages/About";
import Home from "../Pages/Home";
import Login from "../Pages/Login";
import Search from "../Pages/Search";
import Signup from "../Pages/Signup";

export const defaultRoutes = [
  {
    path: "/",
    component: Home,
  },
  {
    path: "/search",
    component: Search,
  },
  {
    path: "/login",
    component: Login,
  },
  {
    path: "/signup",
    component: Signup,
  },
  {
    path: "/about",
    component: About,
  },
];
